import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import React, {useState} from "react";
import {Layout, Col, Row, Divider, Button} from "antd";

const { Header, Footer, Content } = Layout;

const column = [
    {
        title: "Mã Hóa Đơn",
        dataIndex: "MaHD",
        key: "MaHD"
    },
    {
        title: "Tình trạng",
        dataIndex: "TinhTrang",
        key: "TinhTrang"
    },
    {
        title: "Giá tiền",
        dataIndex: "GiaTien",
        key: "GiaTien"
    },
    {
        
            title: "Hành động",
            key: "action",
            render: (_, record) => (
                <Button onClick={() => onClickEdit(record)}
                ></Button>
            ),
    },

]

const DanhSachDH = () => {
    return(
    <div>
        <div>
            <Layout>
                <Content>
                    <Title level={2} classname="titlename">
                    Danh sách đơn hàng
                    </Title>
                    <Table columns={columns} dataSource={listKhachHang} pagination={false} />
                </Content>
            </Layout>
        </div>
    </div>
    );
}
export default DanhSachDH;
